import React, { Component } from "react";
import "../style/ActionBar.css";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { updatePageName } from "../actions/dashboardActions";

class ActionBar extends Component {
  componentWillMount() {
    this.props.updatePageName("Hello World");
  }

  render() {
    const { pageName } = this.props.dashboard;
    console.log(pageName);
    console.log(this.props);

    return (
      <div className="action-bar">
        <span className="ab-page-title mr-auto">{this.props.pageTitle}</span>
      </div>
    );
  }
}

ActionBar.propTypes = {
  dashboard: PropTypes.object.isRequired,
  updatePageName: PropTypes.func.isRequired,
};

const mapStateToProps = (state) => ({
  dashboard: state.dashboard,
});

export default connect(mapStateToProps, { updatePageName })(ActionBar);
